import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AppData() {
  const [data, setData] = useState([]);
  const [inputArray, setInputArray] = useState([]);
  const [responseMessage, setResponseMessage] = useState('');

  // Function to send array to backend
  const sendArrayToBackend = async () => {
    try {
      const arr = [
        "https://firebasestorage.googleapis.com/v0/b/myapp-7e111.appspot.com/o/download%20(1)%20-%20Copy.jpg?alt=media&token=9690b2d7-8a5b-4f94-a699-c80f39d08c03",
        "https://firebasestorage.googleapis.com/v0/b/myapp-7e111.appspot.com/o/image.txt?alt=media&token=bac3efa7-7e34-43e6-bc81-488d1e324a3f",
        "https://firebasestorage.googleapis.com/v0/b/myapp-7e111.appspot.com/o/value.json?alt=media&token=3ecb088e-b15a-4c75-a76a-5b31e3803ef2"
    ];
      const response = await axios.post('http://localhost:5000/api/sendArray', { array: arr });
      setResponseMessage(response.data.success ? 'Array sent successfully' : 'Error sending array');
    } catch (error) {
      console.error('Error sending array:', error);
      setResponseMessage('Error sending array');
    }
  };

  useEffect(() => {
    sendArrayToBackend();
  }, []);

  useEffect(() => {
    // Fetch data from Express server
    axios.get('http://localhost:5000/api/data')
      .then(response => {
        console.log(response.data);
        setData(response.data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Firebase Data</h1>
      <ul>
        {data.map(item => (
          <>
          <li key={item.name}>{item.name}</li>
          <li>{item.url}</li>
          </>
          // Render more properties as needed
        ))}
        <hr/>
        {/* {
          data.values.json.map(item =>(
            <li key={item}>{item}</li>
          ))} */}
      </ul>
    </div>
  );
}

export default AppData;
